Block_Criteria.Criteria:
paaf.ASSIGNMENT_TYPE = 'E' AND ((ppos.ACTUAL_TERMINATION_DATE IS NULL) OR (ppos.ACTUAL_TERMINATION_DATE >= (pay_report_utils.get_parameter_value_date('EFFECTIVE_DATE')- pay_report_utils.get_parameter_value('DESJARDINS_TERM_DAYS') )AND paaf.action_code <> 'GLB_TRANSFER')) AND paaf.EFFECTIVE_LATEST_CHANGE ='Y' AND NOT EXISTS(SELECT 'X' FROM PER_PEOPLE_EXTRA_INFO_F target WHERE PEI_INFORMATION_CATEGORY='AXE_CA_CONTEXT_1' AND UPPER(target.PEI_INFORMATION1)='DO NOT INCLUDE RECORD' AND pay_report_utils.get_parameter_value_date('EFFECTIVE_DATE') BETWEEN target.EFFECTIVE_START_DATE AND target.EFFECTIVE_END_DATE and target.PEI_INFORMATION2='Active'AND target.person_id=paaf.person_id)
/*Include AXE Only Employees*/ AND EXISTS ( SELECT 'x' FROM hr_legal_entities hle WHERE hle.organization_id = paaf.legal_entity_id AND status = 'A' AND classification_code = 'HCM_LEMP' AND TRUNC(SYSDATE) BETWEEN hle.effective_start_date AND hle.effective_end_date AND hle.organization_code IN (SELECT hl.lookup_code FROM hcm_lookups hl WHERE enabled_flag = 'Y' AND lookup_type = 'AXE_HR_ANIXTER_LEGAL_EMP_LKP' ) )
and paaf.ASSIGNMENT_SEQUENCE = ( SELECT MAX(paaf2.ASSIGNMENT_SEQUENCE) FROM PER_ALL_ASSIGNMENTS_F paaf2 WHERE paaf.person_id = paaf2.person_id and paaf2.assignment_type = 'E' and paaf2.primary_flag = 'Y' and pay_report_utils.get_parameter_value_date('EFFECTIVE_DATE') between paaf2.effective_start_date and paaf2.effective_end_date)
